import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Card from './Card';
import {list} from './list.js';
import * as serviceWorker from './serviceWorker';
console.log(list[0].image);
ReactDOM.render(
				 <div className = 'display'>
				 	<Card img = {list[0].image} name = {list[0].name}/>
				 	<Card img = {list[1].image} name = {list[1].name}/>
				 	<Card img = {list[2].image} name = {list[2].name}/>
				 	<Card img = {list[3].image} name = {list[3].name}/>
				 	<Card img = {list[0].image} name = {list[4].name}/>
				 	<Card img = {list[1].image} name = {list[5].name}/>
				 	<Card img = {list[2].image} name = {list[6].name}/>
				 	<Card img = {list[3].image} name = {list[7].name}/>
				 </div>,
				 document.getElementById('root'));

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
